webpackJsonp([80997391711160],{7809:function(t,e){t.exports={data:{post:{html:"<p>Thanks to <a href=\"http://www.paradox1x.org/weblog/kmartino/archives/004709.shtml\">Karl and everyone else</a> who wished me well for my birthday, despite my post telling everyone not to.</p>\n<p>As for my back, I'm making good progress. As my father phrased it, it no longer hurts, it's just stiff and sore. I can sleep through the night without pain, and today I drove to Hamburg and back without any pain for the first time since November. I must be doing something right.</p>",fields:{title:"My Not So Aching Back",date:"21 Feb 2007",url:"https://papascott.de/2007-02-21-my-not-so-aching-back/"}}},pathContext:{slug:"/2007-02-21-my-not-so-aching-back/",prev:{fields:{title:"pfSense: M0n0wall and more",date:"20 Feb 2007",slug:"/2007-02-20-pfsense-m0n0wall-and-more/"}},next:{fields:{title:"Attempted Denial-of-Service Attack",date:"24 Feb 2007",slug:"/2007-02-24-attempted-denial-of-service-attack/"}}}}}});
